BEGIN;

CREATE TABLE "countries" (
    name TEXT NOT NULL
  , "alpha-2" TEXT
  , "alpha-3" TEXT
  , "country-code" TEXT
  , "iso_3166-2" TEXT
  , region TEXT
  , "sub-region" TEXT
  , "intermediate-region" TEXT
  , "region-code" TEXT
  , "sub-region-code" TEXT
  , "intermediate-region-code" TEXT
  , UNIQUE(name)
);


COMMIT;